	(32, 39, 0, 'เป็นสัญญาจ้างก่อสร้าง', 'งานก่อสร้าง หมายถึง งานก่อสร้างตามหลักทั่วไปที่มีกฎหมาย ระเบียบ มติคณะรัฐมนตรี  หรือหนังสือเวียนที่เกี่ยวข้องอ้างอิงได้ และยังให้หมายรวมถึงงานที่มีลักษณะของงาน ตามหนังสือ สำนักนายกรัฐมนตรี ที่ นร (กวพ) 1204/ว 1939 ลงวันที่ 24 กุมภาพันธ์ 2537 เรื่อง งานก่อสร้าง ตามระเบียบสำนักนายกรัฐมนตรีว่าด้วยการพัสดุ พ.ศ. 2535 โดย คณะกรรมการว่าด้วยการพัสดุ (กวพ.) ซ้อมความเข้าใจว่า “งานก่อสร้าง” หมายความรวมถึง (1) งานเคลื่อนย้ายอาคาร (2) งานดัดแปลง งานต่อเติม งานรื้อถอน และงานซ่อมแซม ซึ่งส่วนราชการมีความจำเป็นจะต้องมีการควบคุมดูแลการปฏิบัติงาน ของผู้รับจ้างตลอดเวลาดำเนินการตามความเหมาะสมด้วย', 1, '0', NULL, NULL, '2020-01-06 04:26:44', '2020-06-10 04:29:27'),
